def calculate_net_income(income: int) -> int:
    to_subtract = 0
    brackets = [0, 0, 12500, 25000, 37500, 50000, 62500, 75000]
    bracket = 0
    if income > 1500000:
        bracket = 7
    elif income > 1250000:
        bracket = 6
    elif income > 1000000:
        bracket = 5
    elif income > 750000:
        bracket = 4
    elif income > 500000:
        bracket = 3
    elif income > 250000:
        bracket = 2
    else:
        bracket = 1
    new_list = brackets[0:bracket]
    full_subtracts = sum(new_list)
    to_subtract -= full_subtracts
    unfulled = income - (bracket - 1) * 250000
    unfulled_subtract = unfulled * (0.05 * (bracket - 1))
    to_subtract += unfulled_subtract
    net_income = int(income - to_subtract)
    return net_income

